namespace MacroRecorder.Properties
{
    internal sealed partial class Resources
    {
        private static global::System.Resources.ResourceManager _resourceManager;
        
        internal static global::System.Resources.ResourceManager ResourceManager
        {
            get
            {
                if (object.ReferenceEquals(_resourceManager, null))
                {
                    global::System.Resources.ResourceManager temp = new global::System.Resources.ResourceManager("MacroRecorder.Properties.Resources", typeof(Resources).Assembly);
                    _resourceManager = temp;
                }
                return _resourceManager;
            }
        }
    }
}
